"""
Given a string, find the length of the longest substring without repeating characters. For example, the longest substring without repeating letters for "abcabcbb" is "abc", which the length is 3. For "bbbbb" the longest substring is "b", with the length of 1.
"""

#=> O(n) solution
def lengthOfLongestSubstring2(s):
    """
    :type s: str
    :rtype: int
    """
    if len(s)==0:
        return 0
    #hash table is used to keep a track of the characters and the indexes
    hashTable = {}
    length = 0
    i = 0
    while i<len(s):
        #if a character is already present then record the length till now and start from the next index
        if s[i] in hashTable:
            x = len(hashTable)
            length = max(x,length)
            index = hashTable[s[i]]
            i = index+1
            hashTable = {}
        #if character is not present then add it to the hast table along with it's index
        else:
            hashTable[s[i]] = i
            i += 1
    x = len(hashTable)
    length = max(x,length)
    return length


#=> O(n^2) solution
def lengthOfLongestSubstring(s):
    """
    :type s: str
    :rtype: int
    """
    if len(s)==0:
        return 0
    hashTable = {}
    length = 0
    for i in range(len(s)):
        for j in range(i,len(s)):
            if s[j] in hashTable:
                x = len(hashTable)
                length = max(x,length)
                hashTable = {}
                break
                #hashTable[s[i]] = 0
            else:
                hashTable[s[i]] = 0
        x = len(hashTable)
        length = max(x,length)
    return length



